import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div className="wrap-login">
          <div className="login-form-title">
            Welcome
          </div>
          <label>
            Email:
            <input type="text" name="email" />
          </label>
        </div>
      </header>
    </div>
  );
}

export default App;
